
public class Conditional3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 10; int y = 11;
		  
		  if(!(x < y) || (x == y))
		  {  
			  System.out.println("Condition is TRUE");
		  }
		  else
		  { 
			  System.out.println("Condition is FALSE"); 
		
}

	}

}
